import React from 'react';
// material-ui components
import { makeStyles } from "@material-ui/core/styles";
import Slide from "@material-ui/core/Slide";
import Dialog from "@material-ui/core/Dialog";
import DialogTitle from "@material-ui/core/DialogTitle";
import DialogContent from "@material-ui/core/DialogContent";
import DialogActions from "@material-ui/core/DialogActions";
import IconButton from "@material-ui/core/IconButton";
import InputAdornment from "@material-ui/core/InputAdornment";
import Icon from "@material-ui/core/Icon";
// @material-ui/icons
import Close from "@material-ui/icons/Close";
import Email from "@material-ui/icons/Email";
// core components
import Button from "components/CustomButtons/Button.js";
import Card from "components/Card/Card.js";
import CardBody from "components/Card/CardBody.js";
import CardHeader from "components/Card/CardHeader.js";
import CustomInput from "components/CustomInput/CustomInput.js";
import GridContainer from "components/Grid/GridContainer.js";
import GridItem from "components/Grid/GridItem.js";

import modalStyles from "assets/jss/material-kit-react/modalStyle.js";
import loginStyles from "assets/jss/material-kit-react/views/loginPage.js";

const Transition = React.forwardRef(function Transition(props, ref) {
  return <Slide direction="down" ref={ref} {...props} />;
});

const useModalStyles = makeStyles(modalStyles);
const useLoginStyles = makeStyles(loginStyles);

export default function Modal() {
  const [modal, setModal] = React.useState(false);
  const [cardAnimaton, setCardAnimation] = React.useState("cardHidden");
  const modalClasses = useModalStyles();
  const loginClasses = useLoginStyles();
  setTimeout(function() {
    setCardAnimation("");
  }, 700);
  return (
    <div>
        <Button color="primary" size="sm" simple onClick={() => setModal(true)}>
          Sign up
        </Button>
      <Dialog
        modalClasses={{
          root: modalClasses.center,
          paper: modalClasses.modal
        }}
        open={modal}
        TransitionComponent={Transition}
        keepMounted
        onClose={() => setModal(false)}
        aria-labelledby="modal-slide-title"
        aria-describedby="modal-slide-description"
      >
        <DialogTitle
          id="classic-modal-slide-title"
          disableTypography
          className={modalClasses.modalHeader}
        >
          <IconButton
            className={modalClasses.modalCloseButton}
            key="close"
            aria-label="Close"
            color="inherit"
            onClick={() => setModal(false)}
          >
            <Close className={modalClasses.modalClose} />
          </IconButton>
          <h4 className={modalClasses.modalTitle}>Sign Up</h4>
        </DialogTitle>
        <DialogContent
          id="modal-slide-description"
          className={modalClasses.modalBody}
        >
        <div className={loginClasses.container}>
            <GridContainer justify="center">
                <GridItem xs={12} sm={12} md={4}>
                <Card className={loginClasses[cardAnimaton]}>
                    <form className={loginClasses.form}>
                    <CardHeader color="primary" className={loginClasses.cardHeader}>
                        <h4>Sign up with</h4>
                        <div className={loginClasses.socialLine}>
                        <Button
                            justIcon
                            href="#pablo"
                            target="_blank"
                            color="transparent"
                            onClick={e => e.preventDefault()}
                        >
                            <i className={"fab fa-google"} />
                        </Button>
                        </div>
                    </CardHeader>
                    <CardBody>
                        <CustomInput
                        labelText="Email..."
                        id="email"
                        formControlProps={{
                            fullWidth: true
                        }}
                        inputProps={{
                            type: "email",
                            endAdornment: (
                            <InputAdornment position="end">
                                <Email className={loginClasses.inputIconsColor} />
                            </InputAdornment>
                            )
                        }}
                        />
                        <CustomInput
                        labelText="Password"
                        id="pass"
                        formControlProps={{
                            fullWidth: true
                        }}
                        inputProps={{
                            type: "password",
                            endAdornment: (
                            <InputAdornment position="end">
                                <Icon className={loginClasses.inputIconsColor}>
                                lock_outline
                                </Icon>
                            </InputAdornment>
                            ),
                            autoComplete: "off"
                        }}
                        />
                    </CardBody>
                    </form>
                </Card>
                </GridItem>
            </GridContainer>
        </div>
        </DialogContent>
        <DialogActions
          className={modalClasses.modalFooter + " " + modalClasses.modalFooterCenter}
        >
          <Button style={{minWidth: "70%"}} onClick={() => setModal(false)} color="info">
            Sign Up
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}
